var myApp=angular.module("myApp",[]);myApp.controller("WelcomeController",["$scope","$http",function(a,b){a.note={},a.heading="Here is your message: ",a.getData=function(){b.get("/data").then(function(b){a.messages=b.data,console.log(a.messages)})},a.updateMessage=function(c){console.log(c),b.post("/data",c).then(a.getData())}}]);